(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d224c2b"],{e208:function(n,r){n.exports='## Vue - 项目开发规范\r\n\r\n[参考地址]: https://cn.vuejs.org/v2/style-guide/index.html#%E8%A7%84%E5%88%99%E5%BD%92%E7%B1%BB\t"风格指南"\r\n\r\n\r\n\r\n## 组件文件命名\r\n\r\n**文件名应该要么始终是单词大写开头 (PascalCase)，要么始终是横线连接 (kebab-case)。**\r\n\r\n> 单词大写开头对于代码编辑器的自动补全最为友好，因为这使得我们在 JS(X) 和模板中引用组件的方式尽可能的一致。然而，混用文件命名方式有的时候会导致大小写不敏感的文件系统的问题，这也是横线连接命名同样完全可取的原因。\r\n\r\n正确用法\r\n\r\n反例\r\n\r\n```\r\ncomponents/\r\n|- mycomponent.vue\r\n\r\ncomponents/\r\n|- myComponent.vue\r\n```\r\n\r\n\r\n\r\n好例子\r\n\r\n```javascript\r\ncomponents/\r\n|- MyComponent.vue\r\n\r\ncomponents/\r\n|- my-component.vue\r\n```\r\n\r\n\r\n\r\n## 基础组件命名\r\n\r\n**应用特定样式和约定的基础组件 (也就是展示类的、无逻辑的或无状态的组件) 应该全部以一个特定的前缀开头，比如 `Base`、`App` 或 `V`。**\r\n\r\n\r\n\r\n反例\r\n\r\n```vue\r\ncomponents/\r\n|- MyButton.vue\r\n|- VueTable.vue\r\n|- Icon.vue\r\n```\r\n\r\n好例子\r\n\r\n```\r\ncomponents/\r\n|- BaseButton.vue\r\n|- BaseTable.vue\r\n|- BaseIcon.vue\r\n\r\ncomponents/\r\n|- AppButton.vue\r\n|- AppTable.vue\r\n|- AppIcon.vue\r\n\r\ncomponents/\r\n|- VButton.vue\r\n|- VTable.vue\r\n|- VIcon.vue\r\n```\r\n'}}]);